export function AlertButton({ message }) {
  function sendAlertMessage() {
    alert(message);
  }
  return (
    <CustomEventButton handleClick={sendAlertMessage}>
      trigger alert
    </CustomEventButton>
  );
}

function CustomEventButton({ handleClick, children }) {
  return (
    <>
      <button onClick={handleClick}>{children}</button>
    </>
  );
}
